// DIM Drill Dashboard - React + Tailwind + Supabase Starter (with DIM-M Tracker View)

import { useState, useEffect } from 'react';
import { createClient } from '@supabase/supabase-js';

const supabase = createClient('https://yocwrpuszqwzysikfjrh.supabase.co', 'eyJhbGciOiJIUzI1NiIsInR5cCI6IkpXVCJ9.eyJpc3MiOiJzdXBhYmFzZSIsInJlZiI6InlvY3dycHVzenF3enlzaWtmanJoIiwicm9sZSI6ImFub24iLCJpYXQiOjE3NDQwMTAyMzksImV4cCI6MjA1OTU4NjIzOX0.CX9ibwZL7jrMSEfTqsbhjLMFKeTuuvJ10Q-1KKJmY9E');

export function DrillDashboard() {
  const [drills, setDrills] = useState([]);
  const [newDrill, setNewDrill] = useState({
    name: '',
    purpose: '',
    plane: '',
    muscles: '',
    joint_actions: '',
    nervous_system: '',
    psych_component: '',
    tendons_loaded: '',
    influences: '',
    execution_needs: '',
    regression: '',
    notes: ''
  });

  useEffect(() => {
    fetchDrills();
  }, []);

  async function fetchDrills() {
    const { data, error } = await supabase.from('drills').select('*');
    if (!error) setDrills(data);
  }

  async function addDrill() {
    const { data, error } = await supabase.from('drills').insert([newDrill]);
    if (!error) {
      setDrills([...drills, ...data]);
      setNewDrill({
        name: '', purpose: '', plane: '', muscles: '', joint_actions: '', nervous_system: '',
        psych_component: '', tendons_loaded: '', influences: '', execution_needs: '', regression: '', notes: ''
      });
    }
  }

  function handleChange(field, value) {
    setNewDrill({ ...newDrill, [field]: value });
  }

  return (
    <div className="p-6 max-w-5xl mx-auto">
      <h1 className="text-3xl font-bold mb-6">DIM Drill Dashboard</h1>

      <div className="mb-8">
        <h2 className="text-xl font-semibold mb-4">Add New Drill</h2>
        {Object.keys(newDrill).map((field, index) => (
          <input
            key={index}
            className="border p-2 mb-2 w-full"
            placeholder={field.replace(/_/g, ' ').replace(/\b\w/g, l => l.toUpperCase())}
            value={newDrill[field]}
            onChange={e => handleChange(field, e.target.value)}
          />
        ))}
        <button className="bg-blue-600 text-white px-4 py-2 rounded" onClick={addDrill}>Add Drill</button>
      </div>

      <h2 className="text-xl font-semibold mb-4">Drill Library</h2>
      <div className="space-y-4">
        {drills.map((drill, index) => (
          <div key={index} className="border p-4 rounded shadow">
            <h3 className="text-lg font-bold mb-2">{drill.name}</h3>
            {Object.entries(drill).map(([key, value]) => (
              key !== 'id' && key !== 'name' ? (
                <p key={key}><strong>{key.replace(/_/g, ' ')}:</strong> {value}</p>
              ) : null
            ))}
          </div>
        ))}
      </div>
    </div>
  );
}

export function DimMatrixTracker() {
  const [drills, setDrills] = useState([]);
  const categories = {
    plane: ['sagittal', 'frontal', 'transverse'],
    joint_actions: ['IR', 'ER', 'rotation', 'flexion', 'extension'],
    muscles: ['TVA', 'QL', 'obliques', 'hamstrings', 'multifidus'],
    nervous_system: ['somatic', 'vagal', 'vestibular'],
    psych_component: ['safety', 'confidence', 'fear'],
    execution_needs: ['sit-to-stand', 'hinge', 'rib control', 'pelvic tilt']
  };

  useEffect(() => {
    async function fetchDrills() {
      const { data, error } = await supabase.from('drills').select('*');
      if (!error) setDrills(data);
    }
    fetchDrills();
  }, []);

  function checkCoverage(field, tag) {
    return drills.some(drill => (drill[field] || '').toLowerCase().includes(tag.toLowerCase()));
  }

  return (
    <div className="p-6 max-w-4xl mx-auto">
      <h1 className="text-3xl font-bold mb-6">DIM-M Coverage Tracker</h1>
      <div className="space-y-6">
        {Object.entries(categories).map(([field, tags]) => (
          <div key={field}>
            <h2 className="text-xl font-semibold mb-2 capitalize">{field.replace(/_/g, ' ')}</h2>
            <div className="grid grid-cols-2 sm:grid-cols-3 md:grid-cols-4 gap-2">
              {tags.map(tag => (
                <div
                  key={tag}
                  className={`p-2 rounded border text-center ${checkCoverage(field, tag) ? 'bg-green-200' : 'bg-red-200'}`}
                >
                  {tag}
                </div>
              ))}
            </div>
          </div>
        ))}
      </div>
    </div>
  );
}
